import React from 'react'
import { styled } from '@mui/material/styles';
import Box from '@mui/material/Box';
import Paper from '@mui/material/Paper';
import Grid from '@mui/material/Grid';
import logo from '../assets/images/Untitled design (1).png'
import bg from '../assets/images/loginbg-removebg-preview.png'

const Item = styled(Paper)(({ theme }) => ({
    backgroundColor: theme.palette.mode === 'dark' ? '#1A2027' : '#fff',
    ...theme.typography.body2,
    padding: theme.spacing(1),
    textAlign: 'center',
    color: theme.palette.text.secondary,
  }));

const Login = () => {
  return (
    <div>
    <div style={{ backgroundImage:`url(${bg})`, 
    opacity:0.7,
    width:"100%",
    backgrounPosition: "center",
    backgroundRepeat: "no-repeat",
    backgroundSize: "cover",
    justifyContent:"center"}}>
        <Grid container spacing={2} className='choice1' style={{padding:"40px"}}>
        <Grid item xs={4}>
          <Item>
            <img src={logo} style={{height:"70px"}}></img>
          </Item>
        </Grid>

      </Grid>
    </div>
    </div>
  )
}

export default Login
